org\/wiki\/%D0%A2%D0%B0%D1%86%D0%B8%D1%82\" class=\"mw-redirect\" title=\"\u0422\u0430\u0446\u0438\u0442\">\u0422\u0430\u0446\u0438\u0442\u0430<\/a>. \u0411\u0435\u0434\u0441\u0442\u0432\u0438\u0435 \u043d\u0430\u043d\u0435\u0441\u043b\u043e \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0443\u0440\u043e\u043d \u0433\u043e\u0440\u043e\u0434\u0443, \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0432\u0441\u0435 \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u0432 \u0442\u043e\u0439 \u0438\u043b\u0438 \u0438\u043d\u043e\u0439 \u0441\u0442\u0435\u043f\u0435\u043d\u0438 \u0431\u044b\u043b\u0438 \u043f\u043e\u0432\u0440\u0435\u0436\u0434\u0435\u043d\u044b. \u0411\u043e\u043b\u044c\u0448\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u0437\u0434\u0430\u043d\u0438\u0439 \u0431\u044b\u043b\u0430 \u043e\u0442\u0440\u0435\u043c\u043e\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0430, \u043e\u0434\u043d\u0430\u043a\u043e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u0438 \u043f\u043e\u0432\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f \u0434\u043e \u0441\u0430\u043c\u043e\u0439 \u0433\u0438\u0431\u0435\u043b\u0438 \u0433\u043e\u0440\u043e\u0434\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/79_%D0%B3%D0%BE%D0%B4\" title=\"79 \u0433\u043e\u0434\">79&#160;\u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1204\" class=\"mw-redirect\" title=\"1204\">1204<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_V_%D0%94%D1%83%D0%BA%D0%B0\" title=\"\u0410\u043b\u0435\u043a\u0441\u0435\u0439 V \u0414\u0443\u043a\u0430\">\u0410\u043b\u0435\u043a\u0441\u0435\u0439 V \u0414\u0443\u043a\u0430<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B7%D0%B0%D0%BD%D1%82%D0%B8%D0%B9%D1%81%D0%BA%