ia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%AF%D0%B3%D0%B5%D0%BB%D0%BB%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u042f\u0433\u0435\u043b\u043b\u043e\u043d\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u043c<\/a> \u0438 \u0412\u0435\u043b\u0438\u043a\u0438\u043c \u043a\u043d\u044f\u0437\u0435\u043c \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD_III_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0418\u0432\u0430\u043d III \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d\u043e\u043c III<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D0%BB%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1487%E2%80%941494)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1487\u20141494)\">\u041f\u043e\u0433\u0440\u0430\u043d\u0438\u0447\u043d\u0443\u044e \u0432\u043e\u0439\u043d\u0443 1487\u20141494<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1597\" class=\"mw-redirect\" title=\"1597\">1597<\/a>&#160;\u2014 \u041f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%91%D1%82%D0%BE%D0%BC%D0%B8_%D0%A5%D0%B8%D0%B4%D1%8D%D1%91%D1%81%D0%B8\" title=\"\u0422\u043e\u0451\u0442\u043e\u043c\u0438 \u0425\u0438\u0434\u044d\u0451\u0441\u0438\">\u0422\u043e\u0451\u0442\u043e\u043c\u0438 \u0425\u0438\u0434\u044d\u0451\u0441\u0438<\/a> \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B3%D0%B0%D1%81%D0%B0%D0%BA%D0%B8\" title=\"\u041d\u0430\u0433\u0430\u0441\u0430\u043a\u0438\">\u041d\u0430\u0433\u0430\u0441\u0430