f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u043f\u0435\u0440\u0432\u043e\u0435 \u0438\u0437 <a href=\"https:\/\/en.wikipedia.org\/wiki\/1783_Calabrian_earthquakes\" class=\"extiw\" title=\"en:1783 Calabrian earthquakes\">\u0441\u0435\u0440\u0438\u0438 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0439<\/a>, \u0443\u043d\u0451\u0441\u0448\u0438\u0445 \u0436\u0438\u0437\u043d\u0438 \u043e\u0442 32 \u0434\u043e 50 \u0442\u044b\u0441\u044f\u0447 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D1%80%D0%B0%D1%84_%D0%90%D0%B1%D0%B5%D1%80%D0%B3%D0%B0%D0%B2%D0%B5%D0%BD%D0%BD%D0%B8_(%D1%81%D1%83%D0%B4%D0%BD%D0%BE)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0440\u0430\u0444 \u0410\u0431\u0435\u0440\u0433\u0430\u0432\u0435\u043d\u043d\u0438 (\u0441\u0443\u0434\u043d\u043e) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00ab\u0413\u0440\u0430\u0444 \u0410\u0431\u0435\u0440\u0433\u0430\u0432\u0435\u043d\u043d\u0438\u00bb<\/a>  \u0437\u0430\u0442\u043e\u043d\u0443\u043b\u043e \u0432\u0431\u043b\u0438\u0437\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%BE%D1%80%D1%82%D0%BB%D0%B5%D0%BD%D0%B4_%D0%91%D0%B8%D0%BB%D0%BB&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u043e\u0440\u0442\u043b\u0435\u043d\u0434 \u0411\u0438\u043b\u043b (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041f\u043e\u0440\u0442\u043b\u0435\u043d\u0434 \u0411\u0438\u043b\u043b<\/a> ; \u043f\u043e\u0433\u0438\u0431\u043b\u043e 263 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430.<\/li><l