4<\/a> \u0441\u043e\u043e\u0431\u0449\u0438\u043b \u043e \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u043d\u043e\u043c \u0438\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u0435, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043e\u043d \u043d\u0430\u0437\u0432\u0430\u043b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BA%D0%B5%D0%BB%D0%B8%D1%82\" title=\"\u0411\u0430\u043a\u0435\u043b\u0438\u0442\">\u0431\u0430\u043a\u0435\u043b\u0438\u0442\u043e\u043c<\/a>\u00bb. \u0414\u0430\u043d\u043d\u044b\u0439 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0431\u044b\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0441\u0438\u043d\u0442\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B0%D0%BA%D1%82%D0%BE%D0%BF%D0%BB%D0%B0%D1%81%D1%82%D1%8B\" title=\"\u0420\u0435\u0430\u043a\u0442\u043e\u043f\u043b\u0430\u0441\u0442\u044b\">\u0440\u0435\u0430\u043a\u0442\u043e\u043f\u043b\u0430\u0441\u0442\u043e\u043c<\/a>&#160;\u2014 \u043f\u043b\u0430\u0441\u0442\u0438\u043a\u043e\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0435 \u0440\u0430\u0437\u043c\u044f\u0433\u0447\u0430\u043b\u0441\u044f \u043f\u0440\u0438 \u0432\u044b\u0441\u043e\u043a\u043e\u0439 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913\" class=\"mw-redirect\" title=\"1913\">1913<\/a>&#160;\u2014 \u0413\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u0435 \u043b\u0451\u0442\u0447\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%82%D1%83%D1%81%D0%B8%D1%81,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB\" title=\"\u041c\u0443\u0442\u0443\u0441\u0438\u0441, \u041c\u0438\u0445\u0430\u0438\u043b\">\u041c\u0438\u0445\u0430\u0438\u043b \u041c\u0443\u0442\u0443\u0441\u0438\u0441<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%B0%D0%B9%D1%82%D0%B8%D0%BD%D0%B8%D1%81,_%D0%90%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B4%D