3d\u0434\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u0432\u0437\u044f\u0442\u0438\u0435\u043c \u0440\u0443\u0441\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B0%D0%B1%D0%B7%D0%BE%D0%BD\" title=\"\u0422\u0440\u0430\u0431\u0437\u043e\u043d\">\u0422\u0440\u0430\u043f\u0435\u0437\u0443\u043d\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917\" class=\"mw-redirect\" title=\"1917\">1917<\/a>&#160;\u2014 \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u043c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u041c\u0435\u043a\u0441\u0438\u043a\u0438\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u0428\u0442\u0430\u0442\u043e\u0432 \u041c\u0435\u043a\u0441\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918\" class=\"mw-redirect\" title=\"1918\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432\">\u0421\u043e\u0432\u0435\u0442\u043e\u043c \u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u041a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0420\u0421\u0424\u0421\u0420\">\u0420\u0421\u0424\u0421\u0420<\/a> \u0431\u044b\u043b \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BA%D1%80%D0%B5%D1%82\" title=\"\u0414\u0435\u043a\u0440\u0435\u0442\">\u0434\u0435\u043a\u0440\u0435\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BA%D1%80%D0%B5%D1%82_%D0%BE%D0%B1_%D0%BE%D1%82%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B8_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8_%D0%BE%D1%82_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B0_%D0%B8_%D1%88%D0%BA%D0%BE%D0%BB%D1%8B_%D0%BE%D1%82_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8\" title=\"\u0414\u0435\u043a\u0440\u0435\u0442 \u043e\u0431 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u0438 \u0446\u0435\u0440\u043a\u0432\u0438 \u043e\u0442 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0438 \u0448\u043a\u043e\u043b\u044b \u043e\u0442 \u0446\u0435\u0440\u043a\u0432\u0438\">\u041e\u0431 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u0438 \u0446\u0435\u0440\u043a\u0432\u0438 \u043e\u0442 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0438 \u0448\u043a\u043e\u043b\u044b \u043e\u0442 \u0446\u0435\u0440\u043a\u0432\u0438<\/a>. \u041f\u043e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043f\u0443\u043d\u043a\u0442\u0430\u043c \u0434\u0435\u043a\u0440\u0435\u0442\u0430 \u0440\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u044b\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0431\u044b\u043b\u0438 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u044b \u0432 \u0441\u0432\u043e\u0438\u0445 \u0447\u0430\u0441\u0442\u043d\u044b\u0445 \u043f\u0440\u0430\u0432\u0430\u0445.&#160;\u2014 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Stephen_W._Thompson\" class=\"extiw\" title=\"en:Stephen W. Thompson\">\u0421\u0442\u0435\u0444\u0435\u043d \u0422\u043e\u043c\u043f\u0441\u043e\u043d<\/a>, \u0441\u0431\u0438\u0432 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B0%D1%80%D0%B1%D1%80%D1%8E%D0%BA%D0%BA%D0%B5%D0%BD\" title=\"\u0421\u0430\u0430\u0440\u0431\u0440\u044e\u043a\u043a\u0435\u043d\">\u0421\u0430\u0430\u0440\u0431\u0440\u044e\u043a\u043a\u0435\u043d\u0430<\/a> \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Albatros_D.III\" title=\"Albatros D.III\">Albatros D.III<\/a>, \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0421\u0428\u0410\">\u0432\u043e\u0435\u043d\u043d\u043e\u0441\u043b\u0443\u0436\u0430\u0449\u0438\u043c \u0421\u0428\u0410<\/a>, \u043e\u0434\u0435\u0440\u0436\u0430\u0432\u0448\u0438\u043c \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u0443\u044e \u043f\u043e\u0431\u0435\u0434\u0443.&#160;\u2014 \u041a\u043e\u0440\u0430\u0431\u043b\u044c \u0412\u041c\u0421 \u0421\u0428\u0410 <a href=\"https:\/\/en.wikipedia.org\/wiki\/SS_Tuscania_(1914)\" class=\"extiw\" title=\"en:SS Tuscania (1914)\">SS Tuscania<\/a> \u0442\u043e\u0440\u043f\u0435\u0434\u0438\u0440\u043e\u0432\u0430\u043d \u0438 \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u0443 \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f\">\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u0438<\/a>, \u0441\u0442\u0430\u0432 \u043f\u0435\u0440\u0432\u044b\u043c \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u043c \u043a\u043e\u0440\u0430\u0431\u043b\u0451\u043c \u0438\u0437 \u0447\u0438\u0441\u043b\u0430 \u043f\u0435\u0440\u0435\u0432\u043e\u0437\u0438\u0432\u0448\u0438\u0445 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432 \u0415\u0432\u0440\u043e\u043f\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919\" class=\"mw-redirect\" title=\"1919\">1919<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0415\u0432\u0440\u043e\u043f\u0435<\/a> \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u0430\u044f \u0430\u0432\u0438\u0430\u043b\u0438\u043d\u0438\u044f \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\">\u0412\u0435\u0439\u043c\u0430\u0440<\/a>.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8D%D1%80%D0%B8_%D0%9F%D0%B8%D0%BA%D1%84%D0%BE%D1%80%D0%B4\" title=\"\u041c\u044d\u0440\u0438 \u041f\u0438\u043a\u0444\u043e\u0440\u0434\">\u041c\u044d\u0440\u0438 \u041f\u0438\u043a\u0444\u043e\u0440\u0434<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%8D%D1%80%D0%B1%D0%B5%D0%BD%D0%BA%D1%81,_%D0%94%D1%83%D0%B3%D0%BB%D0%B0%D1%81\" title=\"\u0424\u044d\u0440\u0431\u0435\u043d\u043a\u0441, \u0414\u0443\u0433\u043b\u0430\u0441\">\u0414\u0443\u0433\u043b\u0430\u0441 \u0424\u044d\u0440\u0431\u0435\u043d\u043a\u0441<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%BF%D0%BB%D0%B8%D0%BD,_%D0%A7%D0%B0%D1%80%D0%BB%D1%8C%D0%B7\" title=\"\u0427\u0430\u043f\u043b\u0438\u043d, \u0427\u0430\u0440\u043b\u044c\u0437\">\u0427\u0430\u0440\u043b\u0438 \u0427\u0430\u043f\u043b\u0438\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D1%84%D1%84%D0%B8%D1%82,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4_%D0%A3%D0%BE%D1%80%D0%BA\" title=\"\u0413\u0440\u0438\u0444\u0444\u0438\u0442, \u0414\u044d\u0432\u0438\u0434 \u0423\u043e\u0440\u043a\">\u0414\u044d\u0432\u0438\u0434 \u0413\u0440\u0438\u0444\u0444\u0438\u0442<\/a> \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043b\u0438 \u043a\u0438\u043d\u043e\u0441\u0442\u0443\u0434\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/United_Artists\" title=\"United Artists\">United Artists<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D0%B0_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u0430\u043f\u0430 \u0420\u0438\u043c\u0441\u043a\u0438\u0439\">\u041f\u0430\u043f\u0430 \u0420\u0438\u043c\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B5%D0%B4%D0%B8%D0%BA%D1%82_XV\" title=\"\u0411\u0435\u043d\u0435\u0434\u0438\u043a\u0442 XV\">\u0411\u0435\u043d\u0435\u0434\u0438\u043a\u0442 XV<\/a> \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u0435\u0442 <a href=\"https:\/\/pl.wikipedia.org\/wiki\/Ordynariat_Polowy_Wojska_Polskiego\" class=\"extiw\" title=\"pl:Ordynariat Polowy Wojska Polskiego\">\u0412\u043e\u0435\u043d\u043d\u044b\u0439 \u043e\u0440\u0434\u0438\u043d\u0430\u0440\u0438\u0430\u0442 \u0412\u043e\u0439\u0441\u043a\u0430 \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924\" class=\"mw-redirect\" title=\"1924\">1924<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%B1%D0%B8-%D1%81%D0%B8\" title=\"\u0411\u0438-\u0431\u0438-\u0441\u0438\">\u0412\u0412\u0421<\/a> \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442 \u0435\u0436\u0435\u0447\u0430\u0441\u043d\u0443\u044e \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0443 \u0441\u0438\u0433\u043d\u0430\u043b\u043e\u0432 \u0442\u043e\u0447\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D1%8F\" title=\"\u0412\u0440\u0435\u043c\u044f\">\u0432\u0440\u0435\u043c\u0435\u043d\u0438<\/a>.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BC%D0%BE%D0%BD%D0%B8\" class=\"mw-redirect\" title=\"\u0428\u0430\u043c\u043e\u043d\u0438\">\u0428\u0430\u043c\u043e\u043d\u0438<\/a> \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1924\" title=\"\u0417\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1924\">I \u0437\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0418\u0433\u0440\u044b<\/a>. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D1%87%D1%91%D1%82_%D0%BD%D0%B0_%D0%B7%D0%B8%D0%BC%D0%BD%D0%B8%D1%85_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D1%85_%D0%B8%D0%B3%D1%80%D0%B0%D1%85_1924\" title=\"\u041c\u0435\u0434\u0430\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u0447\u0451\u0442 \u043d\u0430 \u0437\u0438\u043c\u043d\u0438\u0445 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440\u0430\u0445 1924\">\u043c\u0435\u0434\u0430\u043b\u044c\u043d\u043e\u043c \u0437\u0430\u0447\u0451\u0442\u0435<\/a> \u043b\u0443\u0447\u0448\u0438\u043c\u0438 \u0431\u044b\u043b\u0438 <a href=\"https:\/\/r