\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%80%D0%BE%D0%B3%D0%B0_%D0%BF%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B\" title=\"\u0414\u043e\u0440\u043e\u0433\u0430 \u043f\u043e\u0431\u0435\u0434\u044b\">\u0414\u043e\u0440\u043e\u0433\u0430 \u043f\u043e\u0431\u0435\u0434\u044b<\/a>, \u043d\u0430\u043f\u0440\u044f\u043c\u0443\u044e \u0441\u0432\u044f\u0437\u0430\u0432\u0448\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%BE%D0%BA%D0%B0%D0%B4%D0%B0_%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D0%B0\" title=\"\u0411\u043b\u043e\u043a\u0430\u0434\u0430 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0430\">\u0431\u043b\u043e\u043a\u0430\u0434\u043d\u044b\u0439 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434<\/a> \u0441 \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u043e\u0439.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B0%D0%B3%D0%B0\" title=\"\u0413\u0430\u0430\u0433\u0430\">\u0413\u0430\u0430\u0433\u0435<\/a> \u0434\u0432\u0443\u043c\u044f \u0431\u043e\u0439\u0446\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A1%D0%BE%D0%BF%D1%80%D0%BE%D1%82%D0%B8%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_(%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B)\" title=\"\u0414\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u0421\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044f (\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b)\">\u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044f<\/a> \u0438\u0437 \u044f\u0447\u0435\u0439\u043a\u0438 CS-6 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 \u0443\u0441\u043f\u0435\u0448\u043d\u0430\u044f \u0430\u043a\u0446\u0438\u044f \u043f\u0440\u043e\u0442\u0438\u0432 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 <a href=\"https:\/\/nl.wikipedia.org\/wiki\/Hendrik_Seyffardt\" class=\"extiw\" title=\"nl:Hendrik Seyffardt\">\u0425\u0435\u043d\u0434\u0440\u0438\u043a\u0430 \u0421\u0435\u0439\u0444\u0444\u0430\u0440\u0434\u0442\u0430<\/a>, \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f \u043a\u043e\u043b\u043b\u0430\u0431\u043e\u0440\u0430\u0446\u0438\u043e\u043d\u0438\u0441\u0442\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/nl.wikipedia.org\/wiki\/Vrijwilligerslegioen_Nederland\" class=\"extiw\" title=\"nl:Vrijwilligerslegioen Nederland\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0433\u043e \u041b\u0435\u0433\u0438\u043e\u043d\u0430<\/a>.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE%D0%B0%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u0435\u0432\u0435\u0440\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f\">\u0421\u0435\u0432\u0435\u0440\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u0438\u044f\">\u041b\u0438\u0432\u0438\u044f<\/a> \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043f\u0435\u0440\u0435\u0448\u043b\u0430 \u043f\u043e\u0434 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B8%D0%B3%D0%B8%D1%82%D0%BB%D0%B5%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%B0%D0%BB%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u0410\u043d\u0442\u0438\u0433\u0438\u0442\u043b\u0435\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u044f\">\u0430\u043d\u0442\u0438\u0433\u0438\u0442\u043b\u0435\u0440\u043e\u0432\u0441\u043a\u043e\u0439 \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944\" class=\"mw-redirect\" title=\"1944\">1944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%92%D0%A1_%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0412\u0412\u0421 \u0421\u0428\u0410\">\u0412\u0412\u0421 \u0421\u0428\u0410<\/a> \u043d\u0430\u043d\u0435\u0441\u043b\u0438 \u0431\u043e\u043c\u0431\u043e\u0432\u044b\u0439 \u0443\u0434\u0430\u0440 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u041a\u0443\u0440\u0438\u043b\u044c\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u041a\u0443\u0440\u0438\u043b\u044c\u0441\u043a\u0438\u043c \u043e\u0441\u0442\u0440\u043e\u0432\u0430\u043c<\/a>, \u0441\u0430\u043c\u043e\u0439 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945\" class=\"mw-redirect\" title=\"1945\">1945<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_(1944%E2%80%941945)\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f (1944\u20141945)\">\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>: \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Manila_(1945)\" class=\"extiw\" title=\"en:Battle of Manila (1945)\">\u0437\u0430\u043d\u044f\u043b\u0438 \u041c\u0430\u043d\u0438\u043b\u0443<\/a>. \u041e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u044b 5785 \u0443\u0437\u043d\u0438\u043a\u043e\u0432 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Santo_Tomas_Internment_Camp\" class=\"extiw\" title=\"en:Santo Tomas Internment Camp\">\u043b\u0430\u0433\u0435\u0440\u044f \u0434\u043b\u044f \u0432\u043e\u0435\u043d\u043d\u043e\u043f\u043b\u0435\u043d\u043d\u044b\u0445 \u00ab\u0421\u0430\u043d\u0442\u043e-\u0422\u043e\u043c\u0430\u0441\u00bb<\/a>.&#160;\u2014 \u0412 \u0441\u0435\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D1%8B%D1%88_(%D0%91%D1%83%D1%87%D0%B0%D1%87%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)\" title=\"\u0411\u0430\u0440\u044b\u0448 (\u0411\u0443\u0447\u0430\u0447\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d)\">\u0411\u0430\u0440\u044b\u0448<\/a> (\u043e\u043a\u043e\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0422\u0435\u0440\u043d\u043e\u043f\u043e\u043b\u044c\">\u0422\u0435\u0440\u043d\u043e\u043f\u043e\u043b\u044f<\/a>) \u043e\u0442\u0440\u044f\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%9F%D0%90\" class=\"mw-redirect\" title=\"\u0423\u041f\u0410\">\u0423\u041f\u0410<\/a> <a href=\"https:\/\/pl.wikipedia.org\/wiki\/Zbrodnie_w_Baryszu\" class=\"extiw\" title=\"pl:Zbrodnie w Baryszu\">\u0443\u0447\u0438\u043d\u0438\u043b \u0440\u0435\u0437\u043d\u044e<\/a> \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f. 135 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946\" class=\"mw-redirect\" title=\"1946\">1946<\/a>&#160;\u2014 \u0412\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u0441\u0438\u043b\u0443 \u00ab\u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043c\u0435\u0436\u0434\u0443 \u0421\u0421\u0421\u0420 \u0438 \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439 \u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0433\u0440\u0430\u043d\u0438\u0446\u0435\u00bb. \u042e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u0438 \u0437\u0430\u0444\u0438\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0435\u0445\u043e\u0434 \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u044b \u0438 \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u0438 \u043e\u0442 \u041f\u043e\u043b\u044c\u0448\u0438 \u043a \u0421\u0421\u0421\u0420. \u041f\u043e\u043b\u044c\u0448\u0435 \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u043b\u0438\u0441\u044c \u0447\u0430\u0441\u0442\u044c \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0439, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BE%D1%81%D1%82%D0%BE%D0%BA%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C_%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B9_%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0411\u0435\u043b\u043e\u0441\u0442\u043e\u043a\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0421\u0421\u0420\">\u0411\u0435\u043b\u043e\u0441\u0442\u043e\u043a\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a>.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%9D%D0%B0%D1%80%