044f<\/a>, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0438\u0441\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u044c \u0431\u044b\u043b \u043f\u043e\u0442\u0435\u0440\u044f\u043d, \u0430 \u044d\u043a\u0438\u043f\u0430\u0436\u0443 \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u0449\u0438\u043a\u0430 \u043f\u0440\u0438\u0448\u043b\u043e\u0441\u044c \u0430\u0432\u0430\u0440\u0438\u0439\u043d\u043e \u0441\u0431\u0440\u043e\u0441\u0438\u0442\u044c \u0432 \u043e\u043a\u0435\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%B1%D0%BE%D0%BC%D0%B1%D0%B0\" class=\"mw-redirect\" title=\"\u0412\u043e\u0434\u043e\u0440\u043e\u0434\u043d\u0430\u044f \u0431\u043e\u043c\u0431\u0430\">\u0432\u043e\u0434\u043e\u0440\u043e\u0434\u043d\u0443\u044e \u0431\u043e\u043c\u0431\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=Mark_15&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Mark 15 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">Mark 15<\/a>. \u0411\u043e\u043c\u0431\u0430 \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u043d\u0435 \u043d\u0430\u0439\u0434\u0435\u043d\u0430; \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u043e\u043d\u0430 \u043f\u043e\u043a\u043e\u0438\u0442\u0441\u044f \u043d\u0430 \u0434\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A3%D0%BE%D1%81%D1%81%D0%BE_(%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0423\u043e\u0441\u0441\u043e (\u0437\u0430\u043b\u0438\u0432) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0437\u0430\u043b\u0438\u0432\u0430 \u0423\u043e\u0441\u0441\u043e<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;<a href=\"https:\/\/en.wikipedia.org\/wiki\/Wassaw_Sound\" class=\"extiw\" title=\"en:Wassaw Sound\">Wassaw Sound<\/a>) \u043a \u044e\u0433\u0443 \u043e\u0442 \u043a\u0443\u0440\u043e\u0440\u0442\u043d\u043e\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D0%B1%D0%B8-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4_(%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6%D0%B8%D1%8F)\" title=\"\u0422\u0430\u0439\u0431\u0438-\u0410\u0439\u043b\u0435\u043d\u0434 (\u0414\u0436\u043e\u0440\u0434\u0436\u0438\u044f)\">\u0422\u0430\u0439\u0431\u0438-\u0410\u0439\u043b\u0435\u043d\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960\" class=\"mw-redirect\" title=\"1960\">1960<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0426\u041a \u041a\u041f\u0421\u0421 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0421\u0421\u0421\u0420<\/a> \u043e\u0431 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D0%B4%D1%80%D1%83%D0%B6%D0%B1%D1%8B_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BE%D0%B2\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0434\u0440\u0443\u0436\u0431\u044b \u043d\u0430\u0440\u043e\u0434\u043e\u0432\">\u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430 \u0434\u0440\u0443\u0436\u0431\u044b \u043d\u0430\u0440\u043e\u0434\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964\" class=\"mw-redirect\" title=\"1964\">1964<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0444\u0438\u043b\u044c\u043c\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D0%BE%D0%B2%D0%B5%D0%BA_%D0%B8%D0%B7_%D0%A0%D0%B8%D0%BE\" title=\"\u0427\u0435\u043b\u043e\u0432\u0435\u043a \u0438\u0437 \u0420\u0438\u043e\">\u0427\u0435\u043b\u043e\u0432\u0435\u043a \u0438\u0437 \u0420\u0438\u043e<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971\" class=\"mw-redirect\" title=\"1971\">1971<\/a>&#160;\u2014 \u0422\u0440\u0435\u0442\u044c\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0435\u0432 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%BE%D0%BB%D0%BB%D0%BE%D0%BD-14\" title=\"\u0410\u043f\u043e\u043b\u043b\u043e\u043d-14\">Apollo 14<\/a> \u0432\u044b\u0441\u0430\u0436\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u0443<\/a>.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%80%D1%83%D0%B3%D0%B2%D0%B0%D0%B9\" title=\"\u0423\u0440\u0443\u0433\u0432\u0430\u0439\">\u0423\u0440\u0443\u0433\u0432\u0430\u0435<\/a> \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B2%D1%8B%D0%B5_(%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA%D0%B0)\" title=\"\u041b\u0435\u0432\u044b\u0435 (\u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0430)\">\u043b\u0435\u0432\u0430\u044f<\/a> \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u044f, \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u044f\u044e\u0449\u0430\u044f \u0448\u0438\u0440\u043e\u043a\u0438\u0439 \u0441\u043f\u0435\u043a\u0442\u0440 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043f\u0430\u0440\u0442\u0438\u0439, \u043f\u043e \u0431\u043e\u043b\u044c\u0448\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB-%D0%B4%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%8F\" title=\"\u0421\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u044f\">\u0441\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439<\/a> \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u043e\u0441\u0442\u0438, \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A3%D1%80%D1%83%D0%B3%D0%B2%D0%B0%D1%8F\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0423\u0440\u0443\u0433\u0432\u0430\u044f\">\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u043e\u0432<\/a>, \u0431\u044b\u0432\u0448\u0438\u0445 \u0431\u043e\u0439\u0446\u043e\u0432 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BF%D0%B0%D0%BC%D0%B0%D1%80%D0%BE%D1%81\" title=\"\u0422\u0443\u043f\u0430\u043c\u0430\u0440\u043e\u0441\">\u0422\u0443\u043f\u0430\u043c\u0430\u0440\u043e\u0441<\/a>\u00bb (\u00ab\u0414\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0443\u0447\u0430\u0441\u0442\u0438\u044f\u00bb) \u0438 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D1%86%D0%BA%D0%B8%D1%81%D1%82\" class=\"mw-redirect\" title=\"\u0422\u0440\u043e\u0446\u043a\u0438\u0441\u0442\">\u0442\u0440\u043e\u0446\u043a\u0438\u0441\u0442\u0441\u043a\u0438\u0445<\/a> \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439 \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%BE-%D0%B4%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A3%D1%80%D1%83%D0%B3%D0%B2%D0%B0%D1%8F&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0425\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0441\u043a\u043e-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0423\u0440\u0443\u0433\u0432\u0430\u044f (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0445\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0441\u043a\u0438\u0445 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u043e\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B8%D1%80%D0%BE%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"\u0428\u0438\u0440\u043e\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">\u0428\u0438\u0440\u043e\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971\" class=\"mw-redirect\" title=\"1971\">1971<\/a>&#160;\u2014 \u041f\u043e\u044f\u0432\u0438\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D0%BD%D0%B4%D0%BE%D0%B2%D1%8B%D0%B9_%D0%B8%D0%BD%D0%B4%D0%B5%D0%BA%D1%81\" title=\"\u0424\u043e\u043d\u0434\u043e\u0432\u044b\u0439 \u0438\u043d\u0434\u0435\u043a\u0441\">\u0444\u043e\u043d\u0434\u043e\u0432\u044b\u0439 \u0438\u043d\u0434\u0435\u043a\u0441<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/NASDAQ\" title=\"NASDAQ\">NASDAQ<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975\" class=\"mw-redirect\" title=\"1975\">1975<\/a>&#160;\u2014 \u041f\u043e\u043b\u043a\u043e\u0432\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%86%D0%B8%D0%BC%D0%B0%D0%BD%D0%B4%D1%80%D0%B0%D0%B2%D0%B0,_%D0%A0%D0%B8%D1%88%D0%B0%D1%80\" title=\"\u0420\u0430\u0446\u0438\u043c\u0430\u043d\u0434\u0440\u0430\u0432\u0430, \u0420\u0438\u0448\u0430\u0440\">\u0420\u0438\u0448\u0430\u0440 \u0420\u0430\u0446\u0438\u043c\u0430\u043d\u0434\u0440\u0430\u0432\u0430<\/a> \u0432\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%9C%D0%B0%D0%B4%D0%B0%D0%B3%D0%B0%D1%81%D0%BA%D0%B0%D1%80%D0%B0\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u041c\u0430\u0434\u0430\u0433\u0430\u0441\u043a\u0430\u0440\u0430\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u041c\u0430\u0434\u0430\u0433\u0430\u0441\u043a\u0430\u0440\u0430<\/a>, \u0437\u0430\u043d\u044f\u0432 \u0442\u0430\u043a\u0436\u0435 \u043f\u043e\u0441\u0442\u044b \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f. \u0423\u0431\u0438\u0442 \u0432 \u0445\u043e\u0434\u0435 \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u044f \u043f\u043e\u0441\u043b\u0435 \u043d\u0435\u043f\u043e\u043b\u043d\u044b\u0445 \u0441\u0435\u043c\u0438 \u0434\u043d\u0435\u0439 \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979\" class=\"mw-redirect\" title=\"1979\">1979<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8F%D1%82%D0%BE%D0%BB%D0%BB%D0%B0\" title=\"\u0410\u044f\u0442\u043e\u043b\u043b\u0430\">\u0410\u044f\u0442\u043e\u043b\u043b\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%BC%D0%B5%D0%B9%D0%BD%D0%B8,_%D0%A0%D1%83%D1%85%D0%BE%D0%BB%D0%BB%D0%B0_%D0%9C%D1%83%D1%81%D0%B0%D0%B2%D0%B8\" title=\"\u0425\u043e\u043c\u0435\u0439\u043d\u0438, \u0420\u0443\u0445\u043e\u043b\u043b\u0430 \u041c\u0443\u0441\u0430\u0432\u0438\">\u0425\u043e\u043c\u0435\u0439\u043d\u0438<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0418\u0440\u0430\u043d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0418\u0441\u043b\u0430\u043c\u0441\u043a\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\">\u0438\u0441\u043b\u0430\u043c\u0441\u043a\u0438\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c<\/a>.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%B4%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0430\">\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0435<\/a>, \u043d\u0430 \u0431\u0435\u0440\u0435\u0433\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%B5_%D0%A3%D1%8D%D0%B4%D0%B4%D0%B5%D0%BB%D0%BB%D0%B0\" title=\"\u041c\u043e\u0440\u0435 \u0423\u044d\u0434\u0434\u0435\u043b\u043b\u0430\">\u043c\u043e\u0440\u044f \u0423\u044d\u0434\u0434\u0435\u043b\u043b\u0430<\/a>, \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u0430\u044f \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8F%D1%80%D0%BD%D0%B0%D1%8F_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u041f\u043e\u043b\u044f\u0440\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f\">\u043f\u043e\u043b\u044f\u0440\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D1%80%D0%B0%D0%BD%D0%BE_II\" title=\"\u0411\u0435\u043b\u044c\u0433\u0440\u0430\u043d\u043e II\">\u0411\u0435\u043b\u044c\u0433\u0440\u0430\u043d\u043e II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985\" class=\"mw-redirect\" title=\"1985\">1985<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044f<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%B1%D1%80%D0%B0%D0%BB%D1%82%D0%B0%D1%80\" title=\"\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\">\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u043e\u043c<\/a>, \u043f\u043e\u0441\u043b\u0435 16 \u043b\u0435\u0442 \u0437\u0430\u043a\u0440\u044b\u0442\u0438\u044f.&#160;\u2014 \u041c\u044d\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c\u0430<\/a> \u0423\u0433\u043e \u0412\u0435\u0442\u0435\u0440\u0435 \u0438 \u043c\u044d\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%84%D0%B0%D0%B3%D0%B5%D0%BD_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u041a\u0430\u0440\u0444\u0430\u0433\u0435\u043d (\u0433\u043e\u0440\u043e\u0434)\">\u041a\u0430\u0440\u0444\u0430\u0433\u0435\u043d\u0430<\/a> \u0425\u0435\u0434\u043b\u0438 \u041a\u043b\u0438\u0431\u0438 \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u044e\u0442\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BD%D0%B8%D1%81_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u0422\u0443\u043d\u0438\u0441 (\u0433\u043e\u0440\u043e\u0434)\">\u0422\u0443\u043d\u0438\u0441\u0435<\/a>, \u0447\u0442\u043e\u0431\u044b \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u0442\u044c \u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0435\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D1%8C%D1%8F_%D0%9F%D1%83%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0422\u0440\u0435\u0442\u044c\u044f \u041f\u0443\u043d\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0422\u0440\u0435\u0442\u044c\u044e \u041f\u0443\u043d\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>, \u043d\u0430\u0447\u0430\u0432\u0448\u0443\u044e\u0441\u044f 2133 \u0433\u043e\u0434\u0430 \u043d\u0430\u0437\u0430\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987\" class=\"mw-redirect\" title=\"1987\">1987<\/a>&#160;\u2014 \u0421 \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%BE%D0%BD%D1%83%D1%80\" title=\"\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440\">\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440<\/a> \u0437\u0430\u043f\u0443\u0449\u0435\u043d \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A2%D0%9C-2\" title=\"\u0421\u043e\u044e\u0437 \u0422\u041c-2\">\u0421\u043e\u044e\u0437 \u0422\u041c-2<\/a>. \u042d\u043a\u0438\u043f\u0430\u0436: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0420\u043e\u043c\u0430\u043d\u0435\u043d\u043a\u043e, \u042e\u0440\u0438\u0439 \u0412\u0438\u043a\u0442\u043e\u0440\u043e\u0432\u0438\u0447\">\u042e\u0440\u0438\u0439 \u0420\u043e\u043c\u0430\u043d\u0435\u043d\u043a\u043e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B2%D0%B5%D0%B9%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0430\u0432\u0435\u0439\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041b\u0430\u0432\u0435\u0439\u043a\u0438\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989\" class=\"mw-redirect\" title=\"1989\">1989<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b \u0432\u0435\u0449\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439<\/a> 24-\u0447\u0430\u0441\u043e\u0432\u043e\u0439 \u043d\u043e\u0432\u043e\u0441\u0442\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B7%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB_(%D1%81%D1%80%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%BC%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B8%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0422\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u044b\u0439 \u043a\u0430\u043d\u0430\u043b (\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438)\">\u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Sky_News\" title=\"Sky News\">Sky News<\/a>.&#160;\u2014 \u041d\u0430\u0447\u0430\u043b \u0432\u0435\u0449\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B7%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB_(%D1%81%D1%80%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%BC%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B8%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0422\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u044b\u0439 \u043a\u0430\u043d\u0430\u043b (\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438)\">\u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Eurosport\" class=\"mw-redirect\" title=\"Eurosport\">Eurosport<\/a>, \u044f\u0432\u043b\u044f\u044e\u0449\u0438\u0439\u0441\u044f \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u043c \u043e\u0431\u0449\u0435\u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u0421\u043f\u043e\u0440\u0442\">\u0441\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u044b\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B7%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB_(%D1%81%D1%80%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%BC%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B8%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0