B%D1%81%D0%B8,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81\" title=\"\u0412\u0443\u043b\u0441\u0438, \u0420\u043e\u0431\u0435\u0440\u0442 \u0414\u0436\u0435\u0439\u043c\u0441\">\u0420\u043e\u0431\u0435\u0440\u0442 \u0414\u0436\u0435\u0439\u043c\u0441 \u0412\u0443\u043b\u0441\u0438<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B5%D0%BA%D1%82%D0%BE%D1%80_%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B9_%D1%80%D0%B0%D0%B7%D0%B2%D0%B5%D0%B4%D0%BA%D0%B8\" title=\"\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0440\u0430\u0437\u0432\u0435\u0434\u043a\u0438\">\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0426\u0420\u0423<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994\" class=\"mw-redirect\" title=\"1994\">1994<\/a>&#160;\u2014 \u041d\u0430 \u0440\u044b\u043d\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA%D0%B0%D0%BB%D0%B5\" class=\"mw-redirect\" title=\"\u041c\u0430\u0440\u043a\u0430\u043b\u0435\">\u041c\u0430\u0440\u043a\u0430\u043b\u0435<\/a>, \u0432 \u0441\u0442\u043e\u043b\u0438\u0446\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%93%D0%B5%D1%80%D1%86%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%BD%D0%B0\" title=\"\u0411\u043e\u0441\u043d\u0438\u044f \u0438 \u0413\u0435\u0440\u0446\u0435\u0433\u043e\u0432\u0438\u043d\u0430\">\u0411\u043e\u0441\u043d\u0438\u0438 \u0438 \u0413\u0435\u0440\u0446\u0435\u0433\u043e\u0432\u0438\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B0%D0%B5%D0%B2%D0%BE\" title=\"\u0421\u0430\u0440\u0430\u0435\u0432\u043e\">\u0421\u0430\u0440\u0430\u0435\u0432\u0435<\/a>, \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0430\u0441\u044c 120-\u043c\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%BE%D0%BC%D1%91%D1%82\" title=\"\u041c\u0438\u043d\u043e\u043c\u0451\u0442\">\u043c\u0438\u043d\u043e\u043c\u0451\u0442\u043d\u0430\u044f<\/a> \u043c\u0438\u043d\u0430. \u041f\u043e\u0433\u0438\u0431\u043b\u043e 68 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0438 144 \u0431\u044b\u043b\u043e \u0440\u0430\u043d\u0435\u043d\u043e.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%82%D0%B0%D1%80%D1%8C%D1%8F%D0%BC%D0%B8%D1%80%D0%B0,_%D0%A1%D0%B8%D0%BF%D1%80%D0%B8%D0%B5%D0%BD\" title=\"\u041d\u0442\u0430\u0440\u044c\u044f\u043c\u0438\u0440\u0430, \u0421\u0438\u043f\u0440\u0438\u0435\u043d\">\u0421\u0438\u043f\u0440\u0438\u0435\u043d \u041d\u0442\u0430\u0440\u044c\u044f\u043c\u0438\u0440\u0430<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D0%BE%D0%B2_%D0%91%D1%83%D1%80%D1%83%D0%BD%D0%B4%D0%B8\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u0432 \u0411\u0443\u0440\u0443\u043d\u0434\u0438\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0411\u0443\u0440\u0443\u043d\u0434\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997\" class=\"mw-redirect\" title=\"1997\">1997<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BB%D1%8C%D0%B4%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%BE%D0%B1%D1%8B%D1%82%D0%B8%D1%8F\" title=\"\u041a\u0443\u043b\u044c\u0434\u0436\u0438\u043d\u0441\u043a\u0438\u0435 \u0441\u043e\u0431\u044b\u0442\u0438\u044f\">\u041a\u0443\u043b\u044c\u0434\u0436\u0438\u043d\u0441\u043a\u0438\u0435 \u0441\u043e\u0431\u044b\u0442\u0438\u044f<\/a>. \u0412\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043a\u043e\u0440\u0435\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B9%D0%B3%D1%83%D1%80\" class=\"mw-redirect\" title=\"\u0423\u0439\u0433\u0443\u0440\">\u0443\u0439\u0433\u0443\u0440\u0441\u043a\u043e\u0433\u043e<\/a> \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A3%D0%90%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0423\u0410\u0420\">\u0421\u0438\u043d\u044c\u0446\u0437\u044f\u043d-\u0423\u0439\u0433\u0443\u0440\u0441\u043a\u043e\u0433\u043e \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u043e\u0433\u043e \u0440\u0430\u0439\u043e\u043d\u0430<\/a> \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BB%D1%8C%D0%B4%D0%B6%D0%B0\" title=\"\u041a\u0443\u043b\u044c\u0434\u0436\u0430\">\u041a\u0443\u043b\u044c\u0434\u0436\u0430<\/a>, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0433\u043e \u043d\u0430 \u0441\u0435\u0432\u0435\u0440\u043e-\u0437\u0430\u043f\u0430\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%9D%D0%A0\" class=\"mw-redirect\" title=\"\u041a\u041d\u0420\">\u041a\u041d\u0420<\/a>, \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D0%B8-%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BD%D0%BE%D0%BC%D0%BD%D1%8B%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3\" title=\"\u0418\u043b\u0438-\u041a\u0430\u0437\u0430\u0445\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u044b\u0439 \u043e\u043a\u0440\u0443\u0433\">\u0418\u041a\u0410\u041e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000\" class=\"mw-redirect\" title=\"2000\">2000<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B5_%D1%83%D0%B1%D0%B8%D0%B9%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%9D%D0%BE%D0%B2%D1%8B%D1%85_%D0%90%D0%BB%D0%B4%D0%B0%D1%85\" title=\"\u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0432 \u041d\u043e\u0432\u044b\u0445 \u0410\u043b\u0434\u0430\u0445\">\u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0433\u0440\u0443\u043f\u043f\u044b \u043c\u0438\u0440\u043d\u044b\u0445 \u0436\u0438\u0442\u0435\u043b\u0435\u0439<\/a> \u0432 \u043f\u043e\u0441\u0451\u043b\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D1%8B%D0%B5_%D0%90%D0%BB%D0%B4%D1%8B\" title=\"\u041d\u043e\u0432\u044b\u0435 \u0410\u043b\u0434\u044b\">\u041d\u043e\u0432\u044b\u0435 \u0410\u043b\u0434\u044b<\/a> \u0438 \u043f\u0440\u0438\u043b\u0435\u0433\u0430\u044e\u0449\u0438\u0445 \u0440\u0430\u0439\u043e\u043d\u0430\u0445 \u0433. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%BE%D0%B7%D0%BD%D1%8B%D0%B9\" title=\"\u0413\u0440\u043e\u0437\u043d\u044b\u0439\">\u0413\u0440\u043e\u0437\u043d\u043e\u0433\u043e<\/a>. \u041f\u043e \u0434\u0430\u043d\u043d\u044b\u043c \u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u0441\u0443\u0434\u0430 \u043f\u043e \u043f\u0440\u0430\u0432\u0430\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u044f\u0434\u0430 \u0436\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442\u043e\u0432 \u0438 \u043f\u0440\u0430\u0432\u043e\u0437\u0430\u0449\u0438\u0442\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439, \u043e\u043d\u043e \u0431\u044b\u043b\u043e \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043e \u0431\u043e\u0439\u0446\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%9C%D0%9E%D0%9D_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0\" class=\"mw-redirect\" title=\"\u041e\u041c\u041e\u041d \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430\">\u041e\u041c\u041e\u041d\u0430 \u0413\u0423\u0412\u0414 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430 \u0438 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438<\/a> \u0438 \u041e\u041c\u041e\u041d\u0430 \u0423\u0412\u0414 \u043f\u043e \u0420\u044f\u0437\u0430\u043d\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438. \u0421\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0434\u043e\u043a\u043b\u0430\u0434\u0443 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u00ab\u041c\u0435\u043c\u043e\u0440\u0438\u0430\u043b\u00bb, \u0432\u0441\u0435\u0433\u043e \u0431\u044b\u043b\u043e \u0443\u0431\u0438\u0442\u043e 56 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u043f\u043e \u0434\u0430\u043d\u043d\u044b\u043c Human Rights Watch&#160;\u2014 60 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001\" class=\"mw-redirect\" title=\"2001\">2001<\/a>&#160;\u2014 \u041d\u0430 \u0441\u0442\u0430\u043d\u0446\u0438\u0438 \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9A%D0%BE%D0%BB%D1%8C%D1%86%D0%B5%D0%B2%D0%B0%D1%8F_%D0%BB%D0%B8%D0%BD%D0%B8%D1%8F)\" title=\"\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0430\u044f (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e, \u041a\u043e\u043b\u044c\u0446\u0435\u0432\u0430\u044f \u043b\u0438\u043d\u0438\u044f)\">\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0430\u044f-\u043a\u043e\u043b\u044c\u0446\u0435\u0432\u0430\u044f<\/a>\u00bb \u0441\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u043e \u0432\u0437\u0440\u044b\u0432\u043d\u043e\u0435 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004\" class=\"mw-redirect\" title=\"2004\">2004<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%93%D0%B0%D0%B8%D1%82%D0%B8_2004_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0432 \u0413\u0430\u0438\u0442\u0438 2004 \u0433\u043e\u0434\u0430\">\u0413\u0430\u0438\u0442\u044f\u043d\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 2004 \u0433\u043e\u0434\u0430<\/a>: \u0413\u0440\u0443\u043f\u043f\u044b \u043f\u043e\u0432\u0441\u0442\u0430\u043d\u0446\u0435\u0432 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0438 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u043d\u0430\u0434 \u0433\u043e\u0440\u043e\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D0%B0%D0%B8%D0%B2\" title=\"\u0413\u043e\u043d\u0430\u0438\u0432\">\u0413\u043e\u043d\u0430\u0438\u0432\u043e\u043c<\/a>, \u043d\u0430\u0447\u0430\u0432 \u0442\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B0%D0%BD-%D0%91%D0%B5%D1%80%D1%82%D1%80%D0%B0%D0%BD_%D0%90%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B4\" class=\"mw-redirect\" title=\"\u0416\u0430\u043d-\u0411\u0435\u0440\u0442\u0440\u0430\u043d \u0410\u0440\u0438\u0441\u0442\u0438\u0434\">\u0416\u0430\u043d\u0430-\u0411\u0435\u0440\u0442\u0440\u0430\u043d\u0430 \u0410\u0440\u0438\u0441\u0442\u0438\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005\" class=\"mw-redirect\" title=\"2005\">2005<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BD%D0%B0%D1%81%D1%81%D0%B8%D0%BD%D0%B3%D0%B1%D0%B5,_%D0%A4%D0%BE%D1%80_%D0%AD%D1%81%D1%81%D0%BE%D0%B7%D0%B8%D0%BC%D0%BD%D0%B0\" title=\"\u0413\u043d\u0430\u0441\u0441\u0438\u043d\u0433\u0431\u0435, \u0424\u043e\u0440 \u042d\u0441\u0441\u043e\u0437\u0438\u043c\u043d\u0430\">\u0424\u043e\u0440 \u0413\u043d\u0430\u0441\u0441\u0438\u043d\u0433\u0431\u0435<\/a> \u0441\u0442\u0430\u043b \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B3%D0%BE\" title=\"\u0422\u043e\u0433\u043e\">\u0422\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009\" class=\"mw-redirect\" title=\"2009\">2009<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BC%D0%B0%D0%BB%D0%B8\" title=\"\u0421\u043e\u043c\u0430\u043b\u0438\">\u0421\u043e\u043c\u0430\u043b\u0438\u0439\u0441\u043a\u0438\u0435<\/a> \u043f\u0438\u0440\u0430\u0442\u044b, \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u044f \u0432\u044b\u043a\u0443\u043f\u0430 \u0432 \u0440\u0430\u0437\u043c\u0435\u0440\u0435 3,2 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0430 \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432 \u0421\u0428\u0410, \u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u043b\u0438 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D0%B8%D0%BD%D0%B0_(%D1%81%D1%83%D0%B4%D0%BD%D0%BE)\" title=\"\u0424\u0430\u0438\u043d\u0430 (\u0441\u0443\u0434\u043d\u043e)\">\u0424\u0430\u0438\u043d\u0430<\/a>\u00bb.&#160;\u2014 \u0412 \u041f\u0430\u0440\u0438\u0436\u0435 \u043f\u0440\u043e\u0448\u0451\u043b 18-\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B8%D0%B3%D0%B0_(%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)\" title=\"\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043b\u0438\u0433\u0430 (\u0424\u0440\u0430\u043d\u0446\u0438\u044f)\">\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043b\u0438\u0433\u0438<\/a>, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u043e \u0434\u0435\u043b\u0435\u0433\u0430\u0442\u043e\u0432 \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043b\u0438 \u0437\u0430 \u0440\u043e\u0441\u043f\u0443\u0441\u043a \u0420\u041a\u041b. \u041d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0434\u0435\u043d\u044c, 6 \u0444\u0435\u0432\u0440\u0430\u043b\u044f, \u043d\u0430\u0447\u0430\u043b \u0441\u0432\u043e\u044e \u0440\u0430\u0431\u043e\u0442\u0443 \u0443\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0441\u044a\u0435\u0437\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B0%D0%BD%D1%82%D0%B8%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0430\u043d\u0442\u0438\u043a\u0430\u043f\u0438\u0442\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0430\u043d\u0442\u0438\u043a\u0430\u043f\u0438\u0442\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438<\/a>.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0438<\/a> \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u043a\u0438\u043d\u0443\u043b \u0431\u043e\u0442\u0438\u043d\u043e\u043a \u0432 \u043f\u043e\u0441\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044f<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0435\u0433\u043e \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0441\u043a\u043e\u043c \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435<\/a>.&#160;\u2014 \u0412 \u041c\u043e\u0441\u043a\u0432\u0435 \u0443\u0431\u0438\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B5%D0%BA%D1%82%D0%BE%D1%80\" title=\"\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\">\u0433\u0435\u043d\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440<\/a> \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430 \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e-\u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438\u043d\u0432\u0435\u0441\u0442\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%BE%D0%BD,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%98%D0%BE%D1%81%D0%B8%D1%84%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0440\u043e\u043d, \u041b\u0435\u043e\u043d\u0438\u0434 \u0418\u043e\u0441\u0438\u0444\u043e\u0432\u0438\u0447\">\u041b\u0435\u043e\u043d\u0438\u0434 \u0411\u0430\u0440\u043e\u043d<\/a>.&#160;\u2014 \u0412 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0438, \u0432 \u0443\u0433\u043e\u043b\u044c\u043d\u043e\u0439 \u0448\u0430\u0445\u0442\u0435, \u0431\u043b\u0438\u0437 \u043c\u0435\u0441\u0442\u0435\u0447\u043a\u0430 \u041a\u0435\u0440\u0440\u0435\u0445\u043e\u043d, \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u044b \u0438\u0441\u043a\u043e\u043f\u0430\u0435\u043c\u044b\u0435 \u043e\u0441\u0442\u0430\u043d\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%82%D0%B0%D0%BD%D0%BE%D0%B1%D0%BE%D0%B0\" title=\"\u0422\u0438\u0442\u0430\u043d\u043e\u0431\u043e\u0430\">\u0422\u0438\u0442\u0430\u043d\u043e\u0431\u043e\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2012\" class=\"mw-redirect\" title=\"2012\">2012<\/a>&#160;\u2014 \u0412\u043e \u0432\u0442\u043e\u0440\u043e\u043c \u0442\u0443\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D0%B8_(2012)\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0435 \u0432\u044b\u0431\u043e\u0440\u044b \u0432 \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438 (2012)\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u043e\u0432 \u0432 \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438\">\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a> \u0438\u0437\u0431\u0440\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B9%D0%BD%D0%B8%D1%81%D1%82%D1%91,_%D0%A1%D0%B0%D1%83%D0%BB%D0%B8\" title=\"\u041d\u0438\u0439\u043d\u0438\u0441\u0442\u0451, \u0421\u0430\u0443\u043b\u0438\">\u0421\u0430\u0443\u043b\u0438 \u041d\u0438\u0438\u043d\u0438\u0441\u0442\u0451<\/a>.<\/li><\/ul><h2>"}